import React from 'react'
import { Button, Col, Row } from 'react-bootstrap';

 const DateCount = ({data}) => {
  return (
       <Row className="justify-content-center ">
          <Col sm="8" className='fs-5 '>
            <div className='title'>
           <h2>The Employee {data.length}</h2> 
            <input type='search' placeholder='Search' style={{padding:''}}/>
            <Button className='m-2 p-2'>Search</Button>
            </div>
          </Col>
        </Row>
  )
}
export default DateCount;
